import React, { Component } from 'react';
import axios from 'axios';

class StockData extends Component {
    state = {
        info: {}
    }
    componentDidMount() {
        fetch('localhost:4000/stockdata')
        .then(res => res.json())
        .then((data) => {
            this.setState({ info: data})
            console.log(this.state.info)
        })
        .catch(console.log)
    }
}

export default StockData;
